package PSA_;

public class ConsOver2 {
	
	ConsOver2(int x){
		System.out.println(x);
	}
	ConsOver2(char x){
		System.out.println(x);

	}
	ConsOver2(double x){
		System.out.println(x);

	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		ConsOver2 a1 = new ConsOver2(10);
		ConsOver2 a2 = new ConsOver2('a');
		ConsOver2 a3 = new ConsOver2(10.25);
	}

}
